column8:
大人気イラストレーター・漫画家のカナヘイさんが描く、愛らしい小動物たちのグッズに、ピスケのぬいぐるみパスケースが新登場！ 
リール式でバッグに付けたまま改札を通れます。アタマのファスナーには小物入れ！ 
(C) kanahei / TXCOM 

■メーカー：サンアロー
■対象年齢：6歳以上
■サイズ：約17×14×6cm<style type="text/css">
