・ポーチシリーズの表生地ははっ水加工が施されており、お手入れが簡単です。<br>・大きめサイズでトラベルにもgood。<br>・下段にも深さ4.5cmの収納スペースあり。<br>【サニーフィールズとは……】<br>「雨の日でもハッピーな気持ち」をコンセプトに、バラエティ豊かなアイテム展開が特徴のレインブランド。<br>b.y.sは2016年のSunnyfeelsの柄を用いたポーチシリーズです。<br>b.y.s(Be your side)=『いつも持つ人の味方をするポーチ』という思いが込められています。<br><br>【商品スペック】<br>[サイズ]: 高さ/約14cm, 幅/約18cm, 奥行/約9.5cm<br>[重量]: 約80g<br>[企画国]: 日本<br>[素材]: ポリエステル100%<br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
